import React from 'react';
import Listing from '../components/Listing';
import './Home.css';
import NavBar from '../components/NavBar'; // Import NavBar component

const listings = [
  {
    id: 1,
    title: 'Comfortable 1 BHK Flat',
    location: 'Shivtirth Nagar, Kothrud',
    price: '$1500/month',
    image: '/images/background image1.jpg', // Path to the image in public folder
  },
  {
    id: 2,
    title: 'Spacious 3 BHK Flat',
    location: 'Vanaj Corner, Pune',
    price: '$2000/month',
    image: '/images/background image2.jpg',
  },
  {
    id: 3,
    title: 'Stylish 4 BHK Expansive Flat',
    location: 'Shivaji Nagar, Hadapsar',
    price: '$2500/month',
    image: '/images/background image3.jpg',
  },
  {
    id: 4,
    title: 'Roomy 2 BHK Flat',
    location: 'Gokale Colony, Pashan',
    price: '$1700/month',
    image: '/images/background image4.jpg',
  },
  {
    id: 5,
    title: 'Bright 3 BHK Flat',
    location: 'Pratap Nagar, PCMC',
    price: '$2100/month',
    image: '/images/background image5.jpg',
  },
  {
    id: 6,
    title: 'Grand 5 BHK Flat ',
    location: 'Punawale Corner, Pune',
    price: '$3000/month',
    image: '/images/background image6.jpg',
  },
  {
    id: 7,
    title: 'Beautiful 2 Bedroom Apartment',
    location: 'Vanaj Corner, Pune',
    price: '$1700/month',
    image: '/images/background image7.jpg',
  },
  {
    id: 8,
    title: 'Beautiful 2 Bedroom Apartment',
    location: 'Vanaj Corner, Pune',
    price: '$1700/month',
    image: '/images/background image8.jpg',
  },
  {
    id: 9,
    title: 'Beautiful 2 Bedroom Apartment',
    location: 'Vanaj Corner, Pune',
    price: '$1700/month',
    image: '/images/background image9.jpg',
  },
  // Add more listings as needed
];

function Home() {
  const rows = [listings.slice(0, 6), listings.slice(6, 12), listings.slice(12, 18)];

  return (
    <div className="container">
      <NavBar /> {/* Add NavBar component here */}
     
      {rows.map((row, rowIndex) => (
        <div className="flex-container" key={rowIndex}>
          {row.map(listing => (
            <Listing key={listing.id} listing={listing} />
          ))}
        </div>
      ))}
    </div>
  );
}

export default Home;
